import { Nav } from "react-bootstrap"
import MyStyle from '../../styles/colorStyle';
const colour = MyStyle.col_primary;
const Sidebar = () => (
    <div>
        <Form inline style={{ border: '2px solid #E35300', width: '60%', borderRadius: '25px', padding: '0px 5px' }} className="mr-auto">
            <label className="mr-auto">Fuck</label>
            <FormControl type="text" placeholder="Search" className="mr-sm-2" style={{ width: '80%' }} className="mr-auto"></FormControl>
            <Button style={{ background: 'none', border: 'none' }}>Search</Button>
        </Form>
        <Nav defaultActiveKey="/home" className="flex-column">
            <div className="hover"><Nav.Link style={MyStyle.col_border} href="/home">Vendors</Nav.Link></div>
            <div className="hover"><Nav.Link style={MyStyle.col_border} eventKey="link-1">Customers</Nav.Link></div>
            <div className="hover"><Nav.Link style={MyStyle.col_border} eventKey="link-2">Product Categories</Nav.Link></div>
            <div className="hover"><Nav.Link style={MyStyle.col_border} eventKey="link-3">Commision</Nav.Link></div>            <div className="hover"><Nav.Link style={MyStyle.col_border} href="/home">Active</Nav.Link></div>
            <div className="hover"><Nav.Link style={MyStyle.col_border} eventKey="link-1">Global Discount</Nav.Link></div>
            <div className="hover"><Nav.Link style={MyStyle.col_border} eventKey="link-2">Products</Nav.Link></div>
            <div className="hover"><Nav.Link style={MyStyle.col_border} eventKey="link-3">Reports</Nav.Link></div>
            <div className="hover"><Nav.Link style={MyStyle.col_border} eventKey="link-3">Inventory</Nav.Link></div>
        </Nav>
        <style jsx>
            {`
                .hover:hover {
                    margin-left: 10%;
                    margin-right: -10%;
                }
            `}
        </style>
    </div>
)

export default Sidebar;
